import React from 'react'
import Navbar from './Navbar'
import Header from './Header'
import Particles from "react-particles-js"

const Home = () => {
    return (
        <div>
            <Particles
                params={{
                    particles: {
                        number:{
                            value: 45,
                        }
                    }
                }}
            />
            <Navbar />
            <Header />
        </div>
    )
}

export default Home
